import React, { useState, useEffect, useRef } from "react";

const LiquidButton = () => {
  const canvasRef = useRef(null);
  const [pointsA, setPointsA] = useState([]);
  const [pointsB, setPointsB] = useState([]);
  const [mouseX, setMouseX] = useState(0);
  const [mouseY, setMouseY] = useState(0);
  const [relMouseX, setRelMouseX] = useState(0);
  const [relMouseY, setRelMouseY] = useState(0);
  const [mouseLastX, setMouseLastX] = useState(0);
  const [mouseLastY, setMouseLastY] = useState(0);
  const [mouseDirectionX, setMouseDirectionX] = useState(0);
  const [mouseDirectionY, setMouseDirectionY] = useState(0);
  const [mouseSpeedX, setMouseSpeedX] = useState(0);
  const [mouseSpeedY, setMouseSpeedY] = useState(0);

  useEffect(() => {
    const canvas = canvasRef.current;
    const context = canvas.getContext("2d");
    let animationFrameId;

    const points = 8;
    const viscosity = 20;
    const mouseDist = 70;
    const damping = 0.05;
    const showIndicators = false;

    const mouseDirection = (e) => {
      if (mouseX < e.pageX) setMouseDirectionX(1);
      else if (mouseX > e.pageX) setMouseDirectionX(-1);
      else setMouseDirectionX(0);

      if (mouseY < e.pageY) setMouseDirectionY(1);
      else if (mouseY > e.pageY) setMouseDirectionY(-1);
      else setMouseDirectionY(0);

      setMouseX(e.pageX);
      setMouseY(e.pageY);

      setRelMouseX(e.pageX - canvas.offsetLeft);
      setRelMouseY(e.pageY - canvas.offsetTop);
    };

    document.addEventListener("mousemove", mouseDirection);

    const mouseSpeed = () => {
      setMouseSpeedX(mouseX - mouseLastX);
      setMouseSpeedY(mouseY - mouseLastY);

      setMouseLastX(mouseX);
      setMouseLastY(mouseY);
    };

    mouseSpeed();

    const initButton = () => {
      const buttonWidth = canvas.width;
      const buttonHeight = canvas.height;

      setPointsA([]);
      setPointsB([]);

      const addPoints = (x, y) => {
        setPointsA((prevPointsA) => [
          ...prevPointsA,
          {
            x: x,
            y: y,
            ix: x,
            iy: y,
            vx: 0,
            vy: 0,
            cx1: 0,
            cy1: 0,
            cx2: 0,
            cy2: 0,
            level: 1,
          },
        ]);
        setPointsB((prevPointsB) => [
          ...prevPointsB,
          {
            x: x,
            y: y,
            ix: x,
            iy: y,
            vx: 0,
            vy: 0,
            cx1: 0,
            cy1: 0,
            cx2: 0,
            cy2: 0,
            level: 2,
          },
        ]);
      };

      let x = buttonWidth / (points + 1);
      let y = buttonHeight / (points + 1);

      for (let j = 1; j <= points; j++) {
        addPoints(x * j, 0);
        addPoints(x * j, buttonHeight);
      }

      for (let i = 1; i <= points - 2; i++) {
        addPoints(0, y * i);
        addPoints(buttonWidth, y * i);
      }

      const renderCanvas = () => {
        context.clearRect(0, 0, buttonWidth, buttonHeight);

        for (let i = 0; i < pointsA.length; i++) {
          const pointA = pointsA[i];
          const pointB = pointsB[i];

          const dx = pointA.ix - relMouseX;
          const dy = pointA.iy - relMouseY;
          const dist = Math.sqrt(dx * dx + dy * dy);

          if (dist < mouseDist) {
            const angle = Math.atan2(dy, dx);
            const tx = relMouseX + Math.cos(angle) * mouseDist;
            const ty = relMouseY + Math.sin(angle) * mouseDist;

            pointA.vx += tx - pointA.x;
            pointA.vy += ty - pointA.y;
            pointB.vx += tx - pointB.x;
            pointB.vy += ty - pointB.y;
          }

          const dxA = pointA.ix - pointA.x;
          const dyA = pointA.iy - pointA.y;
          const dxB = pointB.ix - pointB.x;
          const dyB = pointB.iy - pointB.y;

          const vx = dxA * viscosity + pointA.vx * (1 - damping);
          const vy = dyA * viscosity + pointA.vy * (1 - damping);

          const vxB = dxB * viscosity + pointB.vx * (1 - damping);
          const vyB = dyB * viscosity + pointB.vy * (1 - damping);

          pointA.vx = (vx - vxB) * 0.5;
          pointA.vy = (vy - vyB) * 0.5;
          pointB.vx = (vxB - vx) * 0.5;
          pointB.vy = (vyB - vy) * 0.5;

          pointA.x += pointA.vx;
          pointA.y += pointA.vy;
          pointB.x += pointB.vx;
          pointB.y += pointB.vy;

          context.beginPath();
          context.moveTo(pointA.x, pointA.y);
          context.lineTo(pointB.x, pointB.y);
          context.lineWidth = pointA.level;
          context.strokeStyle = "rgba(255,255,255,0.5)";
          context.stroke();
        }

        animationFrameId = requestAnimationFrame(renderCanvas);
      };

      renderCanvas();

      return () => {
        cancelAnimationFrame(animationFrameId);
        document.removeEventListener("mousemove", mouseDirection);
      };
    };

    initButton();
  }, []);

  return <canvas ref={canvasRef} />;
};

export default LiquidButton;
